import React from "react";
import HomeButton from "../Sign Up/returnToHomePage";

class MakeQuizEndPage extends React.Component {
    render() {
        return (
            <div>
                <h2>Quiz Created</h2>
                <HomeButton/>
            </div>
        )
    }
}

export default MakeQuizEndPage;
